import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from '../notes'

function card (props){
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
    </div>
  );
}

function App() {
  return (
    <div>
      <Header />
    {  notes.map(card)}
      <Footer />
    </div>
  );
}

export default App;
